static double
score_acceptor_dinucleotide_nucleotides (unsigned char *nucleotides) {
  int i;

  i = nucleotides[ACCEPTOR_MODEL_LEFT_MARGIN - 2]*4 + nucleotides[ACCEPTOR_MODEL_LEFT_MARGIN - 1];
#if 0
  if (i >= 16) {
    abort();
  }
#endif
  return acceptor_scores[i];
}



static bool
sequence_okay (char *sequence, int length) {
  int i;

  for (i = 0; i < length; i++) {
    switch(sequence[i]) {
    case 'A': case 'C': case 'G': case 'T':
    case 'a': case 'c': case 'g': case 't':
      break;
    default: return false;
    }
  }
  return true;
}




/* Expects a 9-mer, 3 bases in exon, 6 bases in intron */
double
Maxent_donor_prob (char *sequence) {
  double maxentscore, odds;

  if (sequence_okay(sequence,DONOR_MODEL_LEFT_MARGIN+DONOR_MODEL_RIGHT_MARGIN) == false) {
    return 0.0;
  } else {
    maxentscore = me2x3donor[hashseq_skip(&(sequence[0]),3,2,4)];
    odds = score_donor_dinucleotide(sequence[DONOR_MODEL_LEFT_MARGIN],sequence[DONOR_MODEL_LEFT_MARGIN+1])*maxentscore;
    return odds/(1.0 + odds);
  }
}

