/* Expects a 23-mer, 20 bases in intron, 3 bases in exon */
double
Maxent_acceptor_prob (char *sequence) {
  double score[9];
  double maxentscore, odds;

  if (sequence_okay(sequence,ACCEPTOR_MODEL_LEFT_MARGIN+ACCEPTOR_MODEL_RIGHT_MARGIN) == false) {
    return 0.0;
  } else {
    score[0] = me2x3acc1[hashseq(&(sequence[0]),7)];
    score[1] = me2x3acc2[hashseq(&(sequence[7]),7)];
    score[2] = me2x3acc3[hashseq_skip(&(sequence[14]),4,2,3)];
    score[3] = me2x3acc4[hashseq(&(sequence[4]),7)];
    score[4] = me2x3acc5[hashseq(&(sequence[11]),7)];
    score[5] = me2x3acc6[hashseq(&(sequence[4]),3)];
    score[6] = me2x3acc7[hashseq(&(sequence[7]),4)];
    score[7] = me2x3acc8[hashseq(&(sequence[11]),3)];
    score[8] = me2x3acc9[hashseq(&(sequence[14]),4)];

    maxentscore = (score[0] * score[1] * score[2] * score[3] * score[4])/
      (score[5] * score[6] * score[7] * score[8]);
    odds = score_acceptor_dinucleotide(sequence[ACCEPTOR_MODEL_LEFT_MARGIN-2],
				       sequence[ACCEPTOR_MODEL_LEFT_MARGIN-1])*maxentscore;
    return odds/(1.0 + odds);
  }
}

